const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: "#1C2833",
      alignItems: "center",
      justifyContent: "center",
    },
  
    text: {
      color: "black",
      fontSize: 25,
      margin: 25,
      fontWeight: "bold",
    },
    img: {
      height: 45,
      width: 45,
      marginBottom: 10,
    },
    ascension: {
      height: 300,
      width: 220,
    },
    capitalize: {
      textTransform: "capitalize",
    },
    scrollView: {
      height: 250,
    },
    viewChar: {
      backgroundColor: "white",
      width: 300,
      height: 500,
      margin: 10,
      alignItems: "center",
      justifyContent: "center",
    },
    tab: {
      fontSize: 145,
    },
  });
  
  export default styles;
